function initializeArray(rows, cols) {
    const newArray = [];
    for (let i = 0; i < rows; i++) {
        const row = [];
        for (let j = 0; j < cols; j++) {
            row.push(undefined); // You can initialize with any default value you prefer
        }
        newArray.push(row);
    }
    return newArray;
}

